import React from "react";
import './index.css';
import {Link} from "react-router-dom";

function HPNavBar(){
    return(
        <div className="navBar" id="homePageNB">
            <ul id="hpURLList">
                <li>Virtual Version</li>
                <li className="nvUpperRightOptions"><Link to="/signup"><button>Log in</button></Link></li>
                <li className="nvUpperRightOptions"><Link href="https://www.google.com/"><button>Sign up</button></Link></li>
            </ul>
        </div> 
    );
}

export default HPNavBar;
